import { defineConfig } from "@playwright/test";

export default defineConfig({
  testDir: ".",
  testMatch: ["**/*.spec.ts"],
  testIgnore: ["**/node_modules/**"],
  fullyParallel: true,
  forbidOnly: !!process.env.CI,
  retries: process.env.CI ? 2 : 0,
  reporter: [ // https://playwright.dev/docs/test-reporters
    [
      "monocart-reporter",
      {
        name: "URL Redirector E2E Coverage Report",
        outputFile: "test/coverage/index.html",
        open: true,
        logging: "warn", // "debug", "info", "warn", "error"
        coverage: {
          lcov: true,
          reports: [
            ['v8'],              // generates JSON format files
            ['html'],             // generates HTML report files
            ['console-details'], // shows CLI table with summary
          ],
          entryFilter: (entry: any) => {
            // Only accept files that are part of YOUR project
            if (entry.url.includes('node_modules')) return false;
            // Only include files that are likely your source code
            const isProjectFile = entry.url.includes('/dist/') || entry.url.includes('/src/')
            // Exclude CSS files
            return isProjectFile && !entry.url.endsWith('.css');
          },
          // Keep source filter to ensure we map back to TS files if possible
          sourceFilter: (sourcePath: string) => sourcePath.search(/src\//) !== -1,
        },
      },
    ],
    ["list"], // compact
    ["html", { outputFolder: "test/playwright-report", open: true }], // artifacts
  ],
  outputDir: "test/test-results",
  use: {
    trace: "retain-on-failure",
    video: "retain-on-failure",
    screenshot: "only-on-failure",
    launchOptions: {
      // slowMo: 100, // Optionally slow down the test execution in the browser. Use with workers: 1 to watch the test execution.
    },
  },
  // workers: 1, // Use 1 worker to run tests serially and watch the test execution.
});

import { test, expect } from './coverage-fixture';
import { build } from '../../scripts/build';
import path from 'path';

test.describe('Build Script', () => {
    let mockExecSync: any;
    let mockFs: any;
    let mockLog: any;
    let mockWarn: any;
    let mockError: any;
    let logs: string[] = [];
    let warns: string[] = [];
    let errors: string[] = [];
    let executedCommands: string[] = [];
    let fsOperations: any[] = [];

    test.beforeEach(() => {
        logs = [];
        warns = [];
        errors = [];
        executedCommands = [];
        fsOperations = [];

        mockLog = (...args: any[]) => logs.push(args.join(' '));
        mockWarn = (...args: any[]) => warns.push(args.join(' '));
        mockError = (...args: any[]) => errors.push(args.join(' '));

        mockExecSync = (cmd: string, options: any) => {
            executedCommands.push(cmd);
            return Buffer.from('');
        };

        mockFs = {
            emptyDirSync: (path: string) => fsOperations.push({ op: 'emptyDirSync', path }),
            existsSync: (path: string) => true,
            readFileSync: (path: string) => {
                if (path.endsWith('manifest.json')) {
                    return JSON.stringify({
                        version: '1.0.0',
                        background: { service_worker: 'dist/background.js' },
                        icons: { "16": "assets/icon16.png" }
                    });
                }
                return '';
            },
            writeFileSync: (path: string, content: string) => {
                fsOperations.push({ op: 'writeFileSync', path, content });
            },
            copy: async (src: string, dest: string) => {
                fsOperations.push({ op: 'copy', src, dest });
            }
        };
    });

    test('should run build process correctly', async () => {
        await build({
            deps: {
                execSync: mockExecSync,
                fs: mockFs,
                log: mockLog,
                warn: mockWarn,
                error: mockError
            }
        });

        // Check logs
        expect(logs.some(l => l.includes('Starting build process'))).toBe(true);
        expect(logs.some(l => l.includes('Build complete'))).toBe(true);

        // Check commands
        expect(executedCommands.some(cmd => cmd.includes('tsc'))).toBe(true);

        // Check FS operations
        expect(fsOperations.some(op => op.op === 'emptyDirSync')).toBe(true);
        expect(fsOperations.some(op => op.op === 'writeFileSync' && op.path.endsWith('manifest.json'))).toBe(true);
        expect(fsOperations.some(op => op.op === 'copy')).toBe(true);

        // Verify manifest adjustment
        const writeOp = fsOperations.find(op => op.op === 'writeFileSync' && op.path.endsWith('manifest.json'));
        const writtenManifest = JSON.parse(writeOp.content);
        expect(writtenManifest.background.service_worker).toBe('background.js');
        expect(writtenManifest.icons["16"]).toBe('icon16.png');
    });

    test('should handle build failure', async () => {
        mockExecSync = () => { throw new Error('TSC Failed'); };

        // Mock process.exit to prevent test from exiting
        const originalExit = process.exit;
        let exitCode: number | undefined;
        process.exit = ((code?: number) => {
            exitCode = code;
            throw new Error('Process Exited');
        }) as any;

        try {
            await build({
                deps: {
                    execSync: mockExecSync,
                    fs: mockFs,
                    log: mockLog,
                    warn: mockWarn,
                    error: mockError
                }
            });
        } catch (e: any) {
            expect(e.message).toBe('Process Exited');
        } finally {
            process.exit = originalExit;
        }

        expect(errors.some(e => e.includes('Build failed'))).toBe(true);
        expect(exitCode).toBe(1);
    });
});

import { test as base } from '@playwright/test';
import { addCoverageReport } from 'monocart-reporter';
import v8 from 'v8';
import fs from 'fs';

export const test = base.extend<{ autoCollectCoverage: void }>({
    autoCollectCoverage: [async ({ }, use, testInfo) => {
        await use();

        try {
            // @ts-ignore - takeCoverage exists in newer Node versions
            const coverage = (v8 as any).takeCoverage();

            if (coverage) {
                try {
                    const urls = coverage.map((c: any) => c.url);
                    fs.appendFileSync('coverage-debug.log', JSON.stringify(urls, null, 2) + '\n');
                } catch (err) {
                    console.error('Failed to write debug log', err);
                }

                // Filter for our scripts
                const filtered = coverage.filter((entry: any) =>
                    entry.url.includes('/scripts/') &&
                    !entry.url.includes('node_modules') &&
                    !entry.url.includes('test/')
                );

                if (filtered.length > 0) {
                    console.log('Found coverage entries:', filtered.length);
                    console.log('Sample URL:', filtered[0].url);
                    await addCoverageReport(filtered, testInfo);
                } else {
                    console.log('No coverage entries found for scripts/');
                }
            }
        } catch (e) {
            console.warn('Failed to collect Node.js coverage:', e);
        }
    }, { auto: true, scope: 'test' }]
});

export const expect = base.expect;

import fs from 'fs-extra';
import path from 'path';
import { execSync as realExecSync } from 'child_process';

const rootDir = path.resolve(__dirname, '..');

export interface BuildOptions {
    customDist?: string;
    deps?: {
        execSync?: typeof realExecSync;
        fs?: typeof fs;
        log?: typeof console.log;
        warn?: typeof console.warn;
        error?: typeof console.error;
    };
}

export async function build(options: BuildOptions = {}) {
    const { customDist, deps = {} } = options;
    const execSync = deps.execSync || realExecSync;
    const fsFn = deps.fs || fs;
    const log = deps.log || console.log;
    const warn = deps.warn || console.warn;
    const error = deps.error || console.error;

    const distDir = customDist ? path.resolve(customDist) : path.join(rootDir, 'dist');

    try {
        log(' Starting build process...');

        // 1. Clean dist directory
        log(' Cleaning dist directory...');
        fsFn.emptyDirSync(distDir);

        // 2. Compile TypeScript
        log(' Compiling TypeScript...');
        // Compile TypeScript with explicit ES2020 module output for the extension
        execSync(
            `tsc --module ES2020 --rootDir src --outDir "${distDir}" --lib ES2020,DOM --sourceMap true`,
            { stdio: 'inherit', cwd: rootDir }
        );

        // 3. Copy static assets
        log(' Copying static assets...');

        // Copy manifest.json with adjustments
        const manifestSrcPath = path.join(rootDir, 'manifest.json');
        const manifestDestPath = path.join(distDir, 'manifest.json');

        if (fsFn.existsSync(manifestSrcPath)) {
            // Read and adjust manifest for dist folder
            const manifestContent = fsFn.readFileSync(manifestSrcPath, 'utf8');
            const manifest = JSON.parse(manifestContent);

            // Adjust background script path: dist/background.js -> background.js
            if (manifest.background && manifest.background.service_worker) {
                manifest.background.service_worker = manifest.background.service_worker.replace('dist/', '');
            }

            // Adjust asset paths: assets/... -> ... (since we copy assets to dist root)
            const manifestStr = JSON.stringify(manifest, null, 2);
            const adjustedManifest = manifestStr.replace(/assets\//g, '');

            fsFn.writeFileSync(manifestDestPath, adjustedManifest);
            log(`    Copied and adjusted manifest.json`);
        }

        // Copy assets directory contents to dist root
        const assetsDir = path.join(rootDir, 'assets');
        if (fsFn.existsSync(assetsDir)) {
            await fsFn.copy(assetsDir, distDir);
            log(`    Copied assets`);
        } else {
            warn(`     assets directory not found, skipping...`);
        }

        log(' Build complete!');
        log(` Extension files are in: ${distDir}`);

    } catch (err: unknown) {
        error(' Build failed:', err);
        process.exit(1);
    }
}

if (require.main === module) {
    const args = process.argv.slice(2);
    const customDist = args[0];
    build({ customDist });
}

import { test, expect } from './coverage-fixture';
import { submitCws } from '../../scripts/submit-cws';
import path from 'path';

test.describe('CWS Submission Script', () => {
    let mockExecSync: any;
    let mockFetch: any;
    let mockLog: any;
    let mockWarn: any;
    let mockLoadSecrets: any;
    let mockFs: any;
    let logs: string[] = [];
    let warns: string[] = [];
    let executedCommands: string[] = [];
    let fetchCalls: any[] = [];

    test.beforeEach(() => {
        logs = [];
        warns = [];
        executedCommands = [];
        fetchCalls = [];

        mockLog = (...args: any[]) => logs.push(args.join(' '));
        mockWarn = (...args: any[]) => warns.push(args.join(' '));

        mockExecSync = (cmd: string, options: any) => {
            executedCommands.push(cmd);
            return Buffer.from('');
        };

        mockFetch = async (url: string, options: any) => {
            fetchCalls.push({ url, options });
            return {
                ok: true,
                json: async () => ({ access_token: 'fake_token', id: 'fake_id' }),
                text: async () => 'ok'
            };
        };

        mockLoadSecrets = async () => {
            // Do nothing, just mock
        };

        mockFs = {
            existsSync: (path: string) => true,
            createReadStream: (path: string) => 'fake_stream',
            readJsonSync: (path: string) => ({ version: '1.0.0' }),
            // Add other methods if needed, but these are the ones used
        };

        // Mock env vars
        process.env.CWS_CLIENT_ID = 'fake_client_id';
        process.env.CWS_CLIENT_SECRET = 'fake_client_secret';
        process.env.CWS_REFRESH_TOKEN = 'fake_refresh_token';
    });

    test('Dry Run: should not call fetch or git push', async () => {
        await submitCws({
            dryRun: true,
            deps: {
                execSync: mockExecSync,
                fetch: mockFetch,
                log: mockLog,
                warn: mockWarn,
                loadGcpSecrets: mockLoadSecrets,
                fs: mockFs
            }
        });

        // Check logs
        expect(logs.some(l => l.includes('DRY RUN'))).toBe(true);
        expect(logs.some(l => l.includes('Skipping Upload and Publish'))).toBe(true);
        expect(logs.some(l => l.includes('Skipping Git Tag and Push'))).toBe(true);
        expect(logs.some(l => l.includes('Run with --submit to actually publish'))).toBe(true);

        // Check commands
        expect(executedCommands).toContain('npm run bundle');
        expect(executedCommands.some(cmd => cmd.includes('git push'))).toBe(false);

        // Check fetch
        expect(fetchCalls.length).toBe(0);
    });

    test('Submit Mode: should call fetch and git push', async () => {
        await submitCws({
            dryRun: false,
            deps: {
                execSync: mockExecSync,
                fetch: mockFetch,
                log: mockLog,
                warn: mockWarn,
                loadGcpSecrets: mockLoadSecrets,
                fs: mockFs
            }
        });

        // Check logs
        expect(logs.some(l => l.includes('SUBMIT MODE'))).toBe(true);
        expect(logs.some(l => l.includes('Authenticating with CWS'))).toBe(true);

        // Check commands
        expect(executedCommands).toContain('npm run bundle');
        expect(executedCommands.some(cmd => cmd.includes('git tag'))).toBe(true);
        expect(executedCommands).toContain('git push && git push --tags');

        // Check fetch
        expect(fetchCalls.length).toBeGreaterThan(0);
        expect(fetchCalls.some(c => c.url.includes('oauth2'))).toBe(true);
        expect(fetchCalls.some(c => c.url.includes('upload'))).toBe(true);
        expect(fetchCalls.some(c => c.url.includes('publish'))).toBe(true);
    });

    test('Error Handling: should fail if upload fails', async () => {
        mockFetch = async (url: string) => {
            if (url.includes('upload')) {
                return {
                    ok: false,
                    status: 500,
                    text: async () => 'Upload Error'
                };
            }
            return {
                ok: true,
                json: async () => ({ access_token: 'fake_token' })
            };
        };

        await expect(submitCws({
            dryRun: false,
            deps: {
                execSync: mockExecSync,
                fetch: mockFetch,
                log: mockLog,
                warn: mockWarn,
                loadGcpSecrets: mockLoadSecrets,
                fs: mockFs
            }
        })).rejects.toThrow('Failed to upload extension: 500 Upload Error');
    });
});

#!/usr/bin/env node

import { loadGcpSecrets } from './load-dotenv-from-gcp';
import { execSync as realExecSync } from 'child_process';
import fs from 'fs-extra';
import path from 'path';

// --- Configuration ---
const EXTENSION_ID_DEFAULT = 'jhkoaofpbohfmolalpieheaeppdaminl';
const PUBLISHER_ID_DEFAULT = 'c173d09b-31cf-48ff-bd4b-270d57317183';

// --- Interfaces ---
export interface SubmitCwsOptions {
    dryRun: boolean;
    deps?: {
        execSync?: typeof realExecSync;
        fetch?: typeof fetch;
        log?: typeof console.log;
        warn?: typeof console.warn;
        error?: typeof console.error;
        loadGcpSecrets?: typeof loadGcpSecrets;
        fs?: typeof fs;
    };
}

// --- Helper Functions ---
async function getAccessToken(clientId: string, clientSecret: string, refreshToken: string, fetchFn: typeof fetch) {
    const response = await fetchFn('https://oauth2.googleapis.com/token', {
        method: 'POST',
        headers: { 'Content-Type': 'application/x-www-form-urlencoded' },
        body: new URLSearchParams({
            client_id: clientId,
            client_secret: clientSecret,
            refresh_token: refreshToken,
            grant_type: 'refresh_token',
        }),
    });

    if (!response.ok) {
        const text = await response.text();
        throw new Error(`Failed to get access token: ${response.status} ${text}`);
    }
    return (await response.json()).access_token;
}

async function uploadExtension(accessToken: string, extensionId: string, zipPath: string, fetchFn: typeof fetch, fsFn: typeof fs) {
    const uploadUrl = `https://www.googleapis.com/upload/chromewebstore/v1.1/items/${extensionId}`;
    const zipStream = fsFn.createReadStream(zipPath);

    // @ts-ignore
    const response = await fetchFn(uploadUrl, {
        method: 'PUT',
        headers: {
            'Authorization': `Bearer ${accessToken}`,
            'x-goog-api-version': '2',
        },
        // @ts-ignore
        body: zipStream,
        duplex: 'half'
    });

    if (!response.ok) {
        const text = await response.text();
        throw new Error(`Failed to upload extension: ${response.status} ${text}`);
    }

    const data = await response.json();
    return data;
}

async function publishExtension(accessToken: string, extensionId: string, fetchFn: typeof fetch) {
    const publishUrl = `https://www.googleapis.com/chromewebstore/v1.1/items/${extensionId}/publish`;

    const response = await fetchFn(publishUrl, {
        method: 'POST',
        headers: {
            'Authorization': `Bearer ${accessToken}`,
            'x-goog-api-version': '2',
        },
    });

    if (!response.ok) {
        const text = await response.text();
        throw new Error(`Failed to publish extension: ${response.status} ${text}`);
    }

    const data = await response.json();
    return data;
}

// --- Main Logic ---
export async function submitCws(options: SubmitCwsOptions) {
    const { dryRun, deps = {} } = options;
    const execSync = deps.execSync || realExecSync;
    const fetchFn = deps.fetch || global.fetch;
    const log = deps.log || console.log;
    const warn = deps.warn || console.warn;
    const loadSecrets = deps.loadGcpSecrets || loadGcpSecrets;
    const fsFn = deps.fs || fs;

    log(` CWS Submission Script (${dryRun ? 'DRY RUN' : 'SUBMIT MODE'})`);

    // 1. Load Secrets
    log(' Loading secrets...');
    await loadSecrets();

    const CLIENT_ID = process.env.CWS_CLIENT_ID;
    const CLIENT_SECRET = process.env.CWS_CLIENT_SECRET;
    const REFRESH_TOKEN = process.env.CWS_REFRESH_TOKEN;
    const EXTENSION_ID = process.env.CWS_EXTENSION_ID || EXTENSION_ID_DEFAULT;

    if (!CLIENT_ID || !CLIENT_SECRET || !REFRESH_TOKEN) {
        if (dryRun) {
            warn(' Missing CWS credentials, but proceeding in DRY RUN mode.');
        } else {
            throw new Error('Missing required environment variables (CWS_CLIENT_ID, CWS_CLIENT_SECRET, CWS_REFRESH_TOKEN).');
        }
    }

    // 2. Bundle Extension
    log(' Bundling extension...');
    execSync('npm run bundle', { stdio: 'inherit' });
    const zipPath = path.resolve(__dirname, '../build/extension.zip');

    if (!fsFn.existsSync(zipPath)) {
        throw new Error(`Bundle failed: ${zipPath} not found.`);
    }

    // 3. Upload & Publish (or Dry Run)
    if (dryRun) {
        log(' [DRY RUN] Skipping Upload and Publish.');
        log(`   Would upload: ${zipPath}`);
        log(`   To Extension ID: ${EXTENSION_ID}`);
        log('  Run with --submit to actually publish.');
    } else {
        log(' Authenticating with CWS...');
        const accessToken = await getAccessToken(CLIENT_ID!, CLIENT_SECRET!, REFRESH_TOKEN!, fetchFn);

        log(' Uploading to Chrome Web Store...');
        const uploadResult = await uploadExtension(accessToken, EXTENSION_ID, zipPath, fetchFn, fsFn);
        log(' Upload successful:', uploadResult);

        log(' Publishing to Chrome Web Store...');
        const publishResult = await publishExtension(accessToken, EXTENSION_ID, fetchFn);
        log(' Publish successful:', publishResult);
    }

    // 4. Git Tag & Push
    const manifestPath = path.resolve(__dirname, '../manifest.json');
    const manifest = fsFn.readJsonSync(manifestPath);
    const version = manifest.version;
    const tagName = `v${version}`;

    if (dryRun) {
        log(` [DRY RUN] Skipping Git Tag and Push.`);
        log(`   Would create tag: ${tagName}`);
        log(`   Would push tag: ${tagName}`);
    } else {
        log(` Creating git tag: ${tagName}`);
        try {
            execSync(`git tag ${tagName}`, { stdio: 'inherit' });
        } catch (e) {
            warn(` Tag ${tagName} might already exist.`);
        }

        log(' Pushing tags to remote...');
        execSync('git push && git push --tags', { stdio: 'inherit' });
    }

    log('\n Submission script finished successfully!');
}

// --- Execution ---
if (require.main === module) {
    (async () => {
        try {
            const args = process.argv.slice(2);
            const isSubmit = args.includes('--submit');
            await submitCws({ dryRun: !isSubmit });
        } catch (error) {
            console.error('\n Script failed:', error);
            process.exit(1);
        }
    })();
}

import { SecretManagerServiceClient } from '@google-cloud/secret-manager';
import dotenv from 'dotenv';

interface SecretManagerError extends Error {
  code?: number;
}

export interface LoadGcpSecretsOptions {
  deps?: {
    SecretManagerServiceClient?: typeof SecretManagerServiceClient;
    log?: typeof console.log;
    error?: typeof console.error;
    exit?: typeof process.exit;
  }
}

export async function loadGcpSecrets(projectId?: string, secretName?: string, options: LoadGcpSecretsOptions = {}): Promise<dotenv.DotenvParseOutput | undefined> {
  const { deps = {} } = options;
  const Client = deps.SecretManagerServiceClient || SecretManagerServiceClient;
  const log = deps.log || console.log;
  const errorLog = deps.error || console.error;
  const exit = deps.exit || process.exit;

  const client = new Client();

  const finalProjectId = projectId || process.env.GOOGLE_CLOUD_PROJECT || 'url-redirector-479005';
  const finalSecretName = secretName || process.env.GCP_SECRET_NAME || 'url-redirector-dotenv';
  const name = `projects/${finalProjectId}/secrets/${finalSecretName}/versions/latest`;

  try {
    const [version] = await client.accessSecretVersion({ name });
    const secretPayload = version.payload?.data?.toString();

    if (!secretPayload) {
      throw new Error('Secret payload is empty');
    }

    const envConfig = dotenv.parse(secretPayload);
    for (const k in envConfig) {
      process.env[k] = envConfig[k];
    }
    return envConfig;

  } catch (error: unknown) {
    const err = error as SecretManagerError;
    // --- ADC GUARD CLAUSE ---
    // Check for common credential errors (Missing ADC, invalid paths, or gRPC Unauthenticated)
    if (
      err.message.includes('Could not load the default credentials') ||
      err.message.includes('no credentials found') ||
      err.code === 16 // gRPC status for UNAUTHENTICATED
    ) {
      errorLog('\n\x1b[31m%s\x1b[0m', 'ERROR: Google Cloud Credentials not found or invalid.'); // Red text
      errorLog('The script cannot access Secret Manager without authentication.');
      errorLog('\nPlease run the following command to log in:');
      errorLog('\x1b[36m%s\x1b[0m', '  gcloud auth application-default login'); // Cyan text
      errorLog('\nOr set GOOGLE_APPLICATION_CREDENTIALS to your key file path.\n');
      exit(1); // Exit gracefully
      return;
    }

    // If it's a different error (e.g., Secret doesn't exist, Permission Denied), rethrow it
    throw error;
  }
}
